;; **
;;; ## Boxplot
;; **

;; @@
(def boxplot-data {:x (into (vec (range 1 11)) (range 1 11))
                   :y (take 20 (repeatedly #(rand 100)))
                   :z (into (vec (take 10 (repeat "this"))) (take 10 (repeat "that")))})
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;icy-abyss/boxplot-data</span>","value":"#'icy-abyss/boxplot-data"}
;; <=

;; @@
(gg4clj/view
    [[:<- :d (gg4clj/data-frame boxplot-data)]
     (gg4clj/r+
       [:ggplot :d [:aes {:x :x :y :y :fill :z}]]
       [:geom_bar {:stat "identity"}]
       [:xlab "X Axis"]
       [:ylab "Y Axis"]
       [:ggtitle "Mixed Boxplot"])]
    {:width 10
     :height 6})
